import React from 'react';

function MessagesPage() {
    return (
        <div className="messages-page">
            <h1>Mesajlarınız</h1>
            <p>Burada mesajlarınızı görüntüleyebilir ve yanıtlayabilirsiniz.</p>
            <textarea placeholder="Mesajınızı yazın..." className="message-textarea"></textarea>
            <button className="send-button">Gönder</button>
        </div>
    );
}

export default MessagesPage;
